/**
 * @param {number[]} nums
 * @return {number}
 */
var maximumSum = function(nums) {
    const factorize = (n) => {
        const factors = new Map();
        for (let div = 2; div * div <= n; div++) {
            while (n % div === 0) {
                factors.set(div, (factors.get(div) || 0) + 1);
                n /= div;
            }
        }
        if (n > 1) factors.set(n, (factors.get(n) || 0) + 1);
        return factors;
    };

    const key = (factors) => {
        let result = '';
        for (const [factor, count] of factors) {
            if (count % 2 !== 0) result += `.${factor}`;
        }
        return result;
    };

    const groups = new Map();
    nums.forEach((num, i) => {
        const k = key(factorize(num));
        if (!groups.has(k)) groups.set(k, []);
        groups.get(k).push(num);
    });

    let maxSum = 0;
    for (const group of groups.values()) {
        maxSum = Math.max(maxSum, group.reduce((a, b) => a + b, 0));
    }

    return maxSum;
};
